Applying group by in pipeline of aggregate with 2 matching documents<p>I need to apply group by on a field named material and sum aggregator on raisedGrnQuantity. Both this material and raisedGrnQuantity are in an array poDetails.
I have constructed a aggregation pipeline to give a rough idea what actually I am trying to do :</p>
<pre><code>var projectQry = [
                {
                    &quot;$unwind&quot;: {
                        path : '$poDetails',
                        preserveNullAndEmptyArrays: true
                    }
                },
                {
                    $match: {
                        &quot;trackNo&quot;: campaignId,
                        &quot;vendorNo&quot;: vendorNo,
                        &quot;poDetails.material&quot;: output[i].materialCode,
                        &quot;status&quot;: &quot;Pending&quot;
                    }
                },
                {
                    $project: {
                        &quot;poDetails.raisedGrnQuantity&quot;: 1,
                        &quot;poDetails.material&quot;: 1
                    }
                }
            ];
</code></pre>
<p>The output of this aggregation pipeline is :</p>
<pre><code>[
  {
    _id: 62de2e7f1ad8470012b9dc75,
    poDetails: { material: '300000114', raisedGrnQuantity: '20' }
  },
  {
    _id: 62de30ea1ad8470012b9dc78,
    poDetails: { material: '300000114', raisedGrnQuantity: '15' }
  }
]
[
  {
    _id: 62de2e7f1ad8470012b9dc75,
    poDetails: { material: '910000029', raisedGrnQuantity: '10' }
  },
  {
    _id: 62de30ea1ad8470012b9dc78,
    poDetails: { material: '910000029', raisedGrnQuantity: '5' }
  }
]
</code></pre>
<p>If we notice, there are two different arrays in output because I have two different matching documents in DB.</p>
<p>Now, what exactly I want to do is to apply group by on the material and sum aggregation on raisedGrnQuantity so that I will have output like below :</p>
<pre><code>  {
    raisedGrnQuantity: '35'
    material: '300000114'
  },
  {
    raisedGrnQuantity: '15'
    material: '910000029'
  }
</code></pre>
<p>I tried to use below group by in the pipeline but it is not giving the correct output. Instead of summation of raisedGrnQuantity, it is showing 0.</p>
<pre><code>$group: {
            _id: &quot;$poDetails.material&quot;,
            raisedGrnQuantity: { $sum: &quot;$poDetails.raisedGrnQuantity&quot; }
        }
</code></pre>
<p>I suspect the issue is because of two matching documents which causes the output to be two different arrays.</p>

