MongoError: E11000 duplicate key error not throwing for unique index<p><code>MongoError: E11000 duplicate key error</code> is not throwing every time userName Kim is created after the first.</p>
<pre class="lang-js prettyprint-override"><code>  // create the first 'Kim' with upsert
  const one = await Order.findOneAndUpdate(
    { userName: 'Kim' },
    { $set: { item: 'Flowers' } },
    { upsert: true, new: false }
  );

  // create duplicate- this doesn't throw a duplicate error
  const two = await Order.create({ userName: 'Kim' });

  // create duplicate- this throws a duplicate error
  const three = await Order.create({ userName: 'Kim' });
</code></pre>
<p>I would expect it two throw both times after the first since there is a <code>unique</code> index on <code>username</code></p>
<pre class="lang-js prettyprint-override"><code>
// Order Schema

const orderSchema = new mongoose.Schema({
  userName: {
    type: String,
    index: { unique: true, partialFilterExpression: { deleted: false } },
  },
  item: { type: String },
});
</code></pre>
<p>This is what shows in the Mongo collection:</p>
<pre class="lang-json prettyprint-override"><code>{&quot;_id&quot;:{&quot;$oid&quot;:&quot;62df67d456a37add52aba9c6&quot;},&quot;userName&quot;:&quot;Kim&quot;,&quot;__v&quot;:{&quot;$numberInt&quot;:&quot;0&quot;},&quot;item&quot;:&quot;Flowers&quot;}

{&quot;_id&quot;:{&quot;$oid&quot;:&quot;62df67d480a625d67e58461b&quot;},&quot;deleted&quot;:false,&quot;userName&quot;:&quot;Kim&quot;,&quot;__v&quot;:{&quot;$numberInt&quot;:&quot;0&quot;}}
</code></pre>
<p>For some reason, <code>&quot;deleted&quot;:false</code> isn't set when I use findAndUpdate to upsert.</p>
<p><strong>Full code</strong></p>
<pre class="lang-js prettyprint-override"><code>const mongoose = require('mongoose');
const mongoose_delete = require('mongoose-delete');

const connect = async (dsn) =&gt;
  mongoose.connect(dsn, {
    useUnifiedTopology: true,
    useNewUrlParser: true,
    useCreateIndex: true,
    autoIndex: true,
  });

// Order Schema

const orderSchema = new mongoose.Schema({
  userName: {
    type: String,
    index: { unique: true, partialFilterExpression: { deleted: false } },
  },
  item: { type: String },
});
orderSchema.plugin(mongoose_delete, {
  indexFields: ['deletedAt'],
  overrideMethods: 'all',
  validateBeforeDelete: false,
});

const Order = mongoose.model('Order', orderSchema);
Order.createIndexes();

// Seeder
const seedLocalDatabase = async () =&gt; {
  await connect('mongodb://127.0.0.1:27017/newtestdb');
  await Order.deleteMany({});
};

(async () =&gt; {
  await seedLocalDatabase();

  const one = await Order.findOneAndUpdate(
    { userName: 'Kim' },
    { $set: { item: 'Flowers' } },
    { upsert: true, new: false }
  );

  // this doesn't throw a duplicate error
  const two = await Order.create({ userName: 'Kim' });

  // this throws a duplicate error
  const three = await Order.create({ userName: 'Kim' });

  mongoose.disconnect();
})();
</code></pre>

